import React from 'react';
import '../../App.css';
import ContactHeader from '../ContactHeader';
import ContactSection from '../ContactSection';
import Footer from '../Footer';

function Home() {
  return (
    <>
      <ContactHeader />
      <ContactSection />
      <Footer />
    </>
  );
}

export default Contact;
